INSERT INTO `about` (`id`, `about_text`, `about_status`, `timestamp`) VALUES
(0, 'Moraj Residency is a wonderful residential project in Sanpada, Navi Mumbai, promoting a harmonious and inclusive community. Its commitment is to foster a diverse and inclusive environment where people of all religions can live happily together, which is commendable. The initiative taken by Moraj Residency to support the well-being of its society members is by offering yoga and dance classes for all which is a great way to encourage a healthy lifestyle and provide opportunities for social engagement. These activities can contribute to physical fitness, stress reduction, and overall well-being. The provision of a play area for kids is another fantastic addition, as it allows children to play, socialize, and develop essential skills in a safe and supervised environment. By promoting a sense of community and inclusivity while prioritizing the health and recreational needs of its residents, Moraj Residency sets an excellent example for other residential projects to follow.\n<br>\n To view the Rules and Regulations of the Society \n<a href=\"\\Rules_and_Regulations.pdf\" target=\"_blank\">Click here.</a><br>\n<marquee><b>New Announcement!! Please check Login.<b></marquee>', 'Approve', '2024-04-21 12:06:15.897458');
