(11, 'Important Notice \n\nDear Residents, \n\nAs all of you know that we have installed   RFID based Smart Parking System in our society. Where vehicle entry/exit will be automatic and seamless with proper transactions as per the specific vehicle with their specific RFID Tags.  \n\nWe are organizing a RFID Tag Activation Desk at society premises shortly.\n\nPark+ will be conducting activities at Tag Activation Camp\n\nA) RFID Tags Activations\nStep 1.  Download Park+ app\nIt is compulsory to download Park+ application in Smartphone for further tag activation, below given is the download link \n  For Android:\n  (https://l.prk.bz/eRwQVUAFBab) \n\n  For iOS: \n(https://apps.apple.com/in/app/park-earlier-parkwheels/id1244749178)\n\nStep 2.  Verify your mobile number\n\nStep 3.  Update your Profile\n\nStep 4.  Click on Vehicle\n\nStep 5.  Click on add new vehicle  \n\nStep 6.  Enter your vehicle details\n\nStep 7.  RFID Tag activation\n\nStep 8.  Rs.10/- Fastag Recharge for Vehicle no. verification \n\nStep 9.  Flat list update and Tag Pasting\n\nNOTE:\n* Residing Member need to carry their smartphones with Park+ app downloaded while coming for the tag activation camp.\n* Residents can also bring their vehicle for Tag Pasting.\n\nThank You,\nManaging Committee', '2024-04-21 11:56:40');
